import './Navbar.css';
import { FaDollarSign, FaShoppingCart, icons } from "react-icons/fa";
import {Link} from "react-router-dom";

function Navbar() {
  
  return (

    <div className="topnav" id="Tnav">
        <span className='Fad'>
          <FaDollarSign/>
        </span>
        <span className='Fad'>
          <FaShoppingCart/>
        </span>
    </div>

  );
}

export default Navbar;


      <div className="dropdown">
       <span>
          <Link to="/Women" />
            <p>Women</p>
            </span>
              <span>
                <Link to="/Men" />
                <p>Men</p>
              </span>
            <span>
              <Link to="/Kids" />
              <p>Kids</p>
            </span>
      </div>
